import React from 'react';

interface ButtonProps {
  onClick: () => void;
  children: React.ReactNode;
  className?: string;
  backgroundColor: string;
  disabled: boolean;
}

const Button: React.FC<ButtonProps> = ({ onClick, children, className, backgroundColor, disabled }) => (
  <button
    onClick={onClick}
    className={`rounded-[48px] ${className}`}
    style={{ backgroundColor: `${backgroundColor}` }} 
    disabled={disabled}
  >
    {children}
  </button>
);

export default Button;
